alb sie jetzt eine Vorabkl\xE4rung er\xF6ffnet habe. Die ausgehandelten Vertragsklauseln, so die Weko, 'k\xF6nnten gem\xE4\xDF einer ersten Einsch\xE4tzung den Wettbewerb nachhaltig beschr\xE4nken und langfristig zu einer Monopolisierung der Glasfasernetzinfrastruktur f\xFChren'. Ins Visier nehmen die Wettbewerbsh\xFCter auch die geplante Gr\xFCndung eines Gemeinschaftsunternehmens zwischen der Swisscom und dem Energieversorger Groupe E zum Aufbau und Betrieb einer gemeinsamen Glasfaserinfrastruktur im Kanton Freiburg. Hier best\xFCnden Anhaltspunkte, dass das Gemeinschaftsunternehmen 'eine marktbeherrschende Stellung begr\xFCndet oder verst\xE4rkt'. (pmz) ",Yec='Dienstag',nBc='Dimension',Hmc='Dimension [height=',Cxc='DirectionalTextHelper',mfc='Do',ffc='Do.',Fxc='DockLayoutPanel',Gxc='DockLayoutPanel$Direction',Hxc='DockLayoutPanel$Direction;',Kxc='DockLayoutPanel$DockAnimateCommand',Ixc='DockLayoutPanel$LayoutData',Ntc='DomEvent',Stc='DomEvent$Type',$ec='Donnerstag',Xzc='Double',Ijc='EAST',hcc='EEE, d MMM yyyy HH:mm:ss Z',Dpc='EEE. dd MMM. yyyy HH:mm:ss',Bcc='EEEE d. MMMM',kcc='EEEE, d. MMMM y',Jac='EM',nhc='EMPTY',shc='ENABLED',zfc='END',Lac='EX',jwc='ElementMapperImpl',kwc='ElementMapperImpl$FreeNode',zec='English',$sc='Enum',qec='Etc/GMT',sec='Etc/GMT+',rec='Etc/GMT-',$ac='Event type',bzc='Event$NativePreviewEvent',duc='EventBus',psc='EventObject',usc='Exception',mic='Expecting version 6 from server, got ',Vbc='F',Mnc='F8834F07517EF3B7D02B9E845E5E1B88',Eac='FIXED',Kic='FLOAT',rnc='Fail: ',Ldc='Feb',Qec='Feb.',Fec='Februar',zdc='February',irc='Female',Yzc='Float',Lxc='FlowPanel',jxc='FocusWidget',Jlc='For input string: "',nfc='Fr',gfc='Fr.',_ec='Freitag',lec='Fri',cec='Friday',mbc='GET',Upc='GGD55XLBAH',Grc='GGD55XLBAJ',Tqc='GGD55XLBBI',Tpc='GGD55XLBCH',Vqc='GGD55XLBCI',Qgc='GGD55XLBDB',Spc='GGD55XLBDH',Prc='GGD55XLBDJ',Cqc='GGD55XLBDK',qgc='GGD55XLBEB',Qpc='GGD55XLBEH',Uqc='GGD55XLBEI',Hrc='GGD55XLBEJ',Rgc='GGD55XLBFB',Xpc='GGD55XLBFH',qrc='GGD55XLBFI',gsc='GGD
